      wx.navigateTo({
        url: "../isActivate/main"
      });
    },
    // 已激活设备
    nav4() {
      wx.navigateTo({
        url: "../isActivate/main?tab=tab1"
      });
    },
    // 未激活设备
    nav5() {
      wx.navigateTo({
        url: "../isActivate/main?tab=tab2"
      });
    },
    // 物料补充
    nav6() {
      wx.navigateTo({
        url: "../receiveDet/main"
      });
    },
    nahuo() {

    },
    getbasedata() {
      this.$fly
        .request({
          method: "post",
          url: "/fx/Flow/flowTotal"
        })
        .then(res => {
          if (res.code == 1) {
            this.basedata = res.data;
          } else {
            wx.showToast({
              title: res.msg,
              icon: "none",
              duration: 1500
            });
          }
        });
    }
  },
  onShow() {
    this.getbasedata();
  },
  created() {}
};
</script>
 
